import React from 'react';
import './Navbar.css';

const Navbar = () => {
    return(
        <nav className ='navbar navbar-nav bg-light shadow'>
            <div className='container-fluid'>
                <div className='container'>
                    <a className='navbar-brand'>Logo</a>
                </div>
                <div className ='container'>
                    <li>Home</li>
                    <li>Search</li>
                    <li>Tweets</li>
                </div>
            </div>
        </nav>
    );
}

export default Navbar;
